pany as a sales representative in 1992. he spent 6 months in an orientation program at the Seattle office and then returned to his permanent po',2,'http://accweb/emmployees/buchanan.bmp',100000),(6,'Suyama','Michael','Sales Representative','Mr.','1963-07-02','1993-10-17','Coventry HouseMiner Rd.','London',NULL,'EC2 7JR','UK','(71) 555-7773','428','Michael is a graduate of Sussex University (MA economics 1983) and the University of California at Los Angeles (MBA marketing 1986).  He has also taken the courses \"Multi-Cultural Selling\" and \"Time Management for the Sales Professional.\"  He is fluent',5,'http://accweb/emmployees/davolio.bmp',140000),(7,'King','Robert','Sales Representative','Mr.','1960-05-29','1994-01-02','Edgeham HollowWinchester Way','London',NULL,'RG1 9SP','UK','(71) 555-5598','465','Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 1992 the year he joined the company.  After completing a course entitled \"Selling in Europe\" he was transferred to the',5,'http://accweb/emmployees/davolio.bmp',240000),(8,'Callahan','Laura','Inside Sales Coordinator','Ms.','1958-01-09','1994-03-05','4726 - 11th Ave. N.E.','Seattle','WA','98105','USA','(206) 555-1189','2344','Laura received a BA in psychology from the University of Washington.  She has also completed a course in business French.  She reads and writes French.',2,'http://accweb/emmployees/davolio.bmp',300000),(9,'Dodsworth','Anne','Sales Representative','Ms.','1966-01-27','1994-11-15','7 Houndstooth Rd.','London',NULL,'WG2 7LT','UK','(71) 555-4444','452','Anne has a BA degree in English from St. Lawrence College.  She is fluent in French and German.',5,'http://accweb/emmployees/davolio.bmp',220000);
